import React from 'react'
import Manifest from './manifest.json'

const Section = (data) => {
    var i = data.data
    return (
    <div className='mx-5 grid grid-flow-row grid-row-2 p-7 border border-black border-opacity-20 rounded-xl text-center w-72'>
        <div className='font-bold text-lg leading-0 opacity-90 lg:text-xl'>{i.heading}</div>
        <div className='font-medium text-base leading-0 opacity-90 lg:text-base'>{i.paragraph}</div>
    </div>
    )
}

const TheWhy = () => {
    return (
    <div className='flex flex-col justify-center bg-white mb-20 md:text-center'>
        <div className='font-extrabold text-2xl opacity-90 mb-12 p-10 pb-0'>{Manifest.title}</div>
        <div className='overflow-y-scroll'>
            <div className='grid grid-flow-col grid-cols-3 w-max'>
            {Manifest.content.map((i, key) => {
                    return <Section key={key} data={i}/>;
                    })}
            </div>
        </div>
    </div>
    )
}

export default TheWhy
